describe('medicusPlugin()', () => {
  it('registers a health check route', async () => {
    await using app = fastify();
    await app.register(medicusPlugin, {});

    assert.ok(app.medicus instanceof Medicus);

    const response = await app.inject({
      method: 'GET',
      url: '/health'
    });

    assert.deepStrictEqual(response.json(), {
      status: HealthStatus.HEALTHY,
      services: {}
    });
  });

  it('uses cached version when ?last=true', async () => {
    await using app = fastify();

    let last = false;

    await app.register(medicusPlugin, {
      checkers: {
        async checker() {
          last = !last;
          return last ? HealthStatus.HEALTHY : HealthStatus.UNHEALTHY;
        }
      }
    });

    const response = await app.inject({
      method: 'GET',
      url: '/health?last=true'
    });

    assert.deepStrictEqual(response.json(), {
      status: HealthStatus.HEALTHY,
      services: {}
    });

    const response2 = await app.inject({
      method: 'GET',
      url: '/health?last=true'
    });

    assert.deepStrictEqual(response2.json(), {
      // cached
      status: HealthStatus.HEALTHY,
      services: {}
    });
  });

  it('uses new version when ?last=false', async () => {
    await using app = fastify();

    let last = false;

    await app.register(medicusPlugin, {
      checkers: {
        async checker() {
          last = !last;
          return last ? HealthStatus.HEALTHY : HealthStatus.UNHEALTHY;
        }
      }
    });

    const response = await app.inject({
      method: 'GET',
      url: '/health?last=false'
    });

    assert.deepStrictEqual(response.json(), {
      status: HealthStatus.HEALTHY,
      services: {}
    });

    const response2 = await app.inject({
      method: 'GET',
      url: '/health?last=false'
    });

    assert.deepStrictEqual(response2.json(), {
      // not cached
      status: HealthStatus.UNHEALTHY,
      services: {}
    });
  });

  it('auto registers under-pressure checker', async () => {
    await using app = fastify();
    await app.register(import('@fastify/under-pressure'));
    await app.register(medicusPlugin, {
      debug: true
    });

    const response = await app.inject({
      method: 'GET',
      url: '/health'
    });

    assert.deepStrictEqual(response.json(), {
      // non debug
      status: HealthStatus.HEALTHY,
      services: {
        pressure: {
          status: HealthStatus.HEALTHY,
          // idk why its 0 but not our concern
          debug: { eventLoopDelay: 0, rssBytes: 0, heapUsed: 0, eventLoopUtilized: 0 }
        }
      }
    });
  });

  it('works with per request debug', async () => {
    await using app = fastify();
    await app.register(medicusPlugin, {
      checkers: {
        request() {
          return {
            status: HealthStatus.HEALTHY,
            debug: {
              request: 'debug'
            }
          }
        }
      },
      debug(req) {
        return req.headers['x-debug'] === '1233';
      }
    });

    const response1 = await app.inject({
      method: 'GET',
      url: '/health',
      headers: {
        'x-debug': '1233'
      }
    });

    assert.deepStrictEqual(response1.json(), {
      status: HealthStatus.HEALTHY,
      services: {
        request: {
          status: HealthStatus.HEALTHY,
          debug: {
            request: 'debug'
          }
        }
      }
    });

    const response2 = await app.inject({
      method: 'GET',
      url: '/health'
    });

    assert.deepStrictEqual(response2.json(), {
      status: HealthStatus.HEALTHY,
      services: {}
    });

    const response3 = await app.inject({
      method: 'GET',
      url: '/health',
      headers: {
        'x-debug': 'not 1233'
      }
    });

    assert.deepStrictEqual(response3.json(), {
      status: HealthStatus.HEALTHY,
      services: {}
    });
  })
});

export * from './types';
export * from './medicus';
export * as Schemas from './schemas';

import type { Medicus } from './medicus';

export enum HealthStatus {
  HEALTHY = 'healthy',
  DEGRADED = 'degraded',
  UNHEALTHY = 'unhealthy'
}

export interface DetailedHealthCheck {
  /**
   * The status of the health check
   */
  status: HealthStatus;

  /**
   * A list of key-value pairs with additional information about the health check
   * to be shown in the debug output
   */
  debug?: Record<string, number | boolean | string>;
}

export interface HealthCheckResult {
  /**
   * The status of the health check
   */
  status: HealthStatus;

  /**
   * A per service breakdown of the health check results
   */
  services: Record<string, DetailedHealthCheck>;
}

/**
 * A health check function that can be used to check if a part of the system is healthy
 */
export interface HealthChecker {
  (
    this: void
  ):
    | void
    | HealthStatus
    | DetailedHealthCheck
    | Promise<void>
    | Promise<HealthStatus>
    | Promise<DetailedHealthCheck>;

  /** The (sub)service name this checks for */
  name: string;
}

export interface MedicusOption {
  /**
   * List of checkers to automatically add to the medicus instance
   */
  checkers?: Record<string, HealthChecker>;

  /**
   * If provided, this function will be called whenever an error occurs during the execution of a health check
   */
  errorLogger?: (error: unknown, checkerName: string) => void;

  /**
   * By default {@linkcode Medicus.performCheck} needs to be called manually to perform a health check.
   *
   * If set to true, the health check will be performed automatically in the background at the specified interval.
   *
   * @default null
   */
  backgroundCheckInterval?: number;

  /**
   * If set to true, {@linkcode Medicus.closeBackgroundCheck} should be manually called to stop the background check.
   *
   * @default false
   */
  manualClearBackgroundCheck?: boolean;
}

import closeWithGrace from 'close-with-grace';
import {
  type DetailedHealthCheck,
  type HealthCheckResult,
  type HealthChecker,
  HealthStatus,
  type MedicusOption
} from './types';

/**
 * A class that can be used to perform health checks on a system
 */
export class Medicus {
  private checkers: Map<string, HealthChecker> = new Map();
  private lastCheck: HealthCheckResult | null = null;

  /**
   * The interval id of the background check if it's running
   */
  private backgroundCheckIntervalId: NodeJS.Timeout | null = null;

  constructor(private readonly options: MedicusOption = {}) {
    if (this.options.checkers) {
      this.addChecker(this.options.checkers);
    }

    this.#handleBackgroundCheck();
  }

  /**
   * Adds a new checker to be executed when the health check is run
   */
  addChecker(checkers: Record<string, HealthChecker>): void {
    for (const name in checkers) {
      if (this.checkers.has(name)) {
        throw new Error(`A checker with the name "${name}" is already registered`);
      }

      this.checkers.set(name, checkers[name]!);
    }
  }

  /**
   * Returns an read-only iterator of all the checkers
   */
  listCheckers(): MapIterator<HealthChecker> {
    return this.checkers.values();
  }

  /**
   * Removes a checker from the list of checkers to be executed
   */
  removeChecker(...checkerOrNames: (HealthChecker | string)[]): void {
    for (const checker of checkerOrNames) {
      this.checkers.delete(typeof checker === 'function' ? checker.name : checker);
    }
  }

  /**
   * Returns the last health check result
   */
  getLastCheck(): HealthCheckResult | null {
    return this.lastCheck;
  }

  /**
   * Performs a health check and returns the result
   */
  performCheck = async (): Promise<HealthCheckResult> => {
    let status = HealthStatus.HEALTHY;
    const services: Record<string, DetailedHealthCheck> = {};

    for await (const [serviceName, result] of this.#runChecks()) {
      if (result.status === HealthStatus.UNHEALTHY) {
        status = HealthStatus.UNHEALTHY;
      }

      services[serviceName] = result;
    }

    // updates the last check result
    this.lastCheck = {
      status,
      services
    };

    return this.lastCheck;
  };

  /**
   * Returns a generator that runs all the health checks and yields the results
   */
  async *#runChecks() {
    for (const [name, checker] of this.checkers) {
      yield this.#executeChecker(checker).then((res) => [name, res] as const);
    }
  }

  /**
   * Runs a single health check and returns the result
   *
   * **This function never throws**
   */
  async #executeChecker(checker: HealthChecker): Promise<DetailedHealthCheck> {
    try {
      const check = await checker();

      switch (typeof check) {
        case 'string':
          return { status: check };
        case 'object':
          return check;
        default:
          return { status: HealthStatus.HEALTHY };
      }
    } catch (error: any) {
      if (this.options.errorLogger) {
        this.options.errorLogger(error, checker.name);
      }

      return {
        status: HealthStatus.UNHEALTHY,
        debug: { error }
      };
    }
  }

  /**
   * Starts the background check if it's not already running
   */
  #handleBackgroundCheck() {
    if (
      // already called
      this.backgroundCheckIntervalId ||
      // no interval set
      !this.options.backgroundCheckInterval
    ) {
      return;
    }

    this.backgroundCheckIntervalId = setInterval(
      this.performCheck,
      this.options.backgroundCheckInterval
    );

    if (!this.options.manualClearBackgroundCheck) {
      closeWithGrace(
        {
          delay: 500,
          logger: this.options.errorLogger ? { error: this.options.errorLogger } : undefined
        },
        this.closeBackgroundCheck
      );
    }
  }

  /**
   * Stops the background check if it's running
   */
  readonly closeBackgroundCheck = (): void => {
    if (this.backgroundCheckIntervalId) {
      clearInterval(this.backgroundCheckIntervalId);
      this.backgroundCheckIntervalId = null;
    }
  };

  /** to be used as `using medicus = new Medicus()` */
  [Symbol.dispose]() {
    this.closeBackgroundCheck();
  }
}

import { Type } from '@sinclair/typebox';
import { HealthStatus } from './types';

export const HealthStatusSchema = Type.Enum(HealthStatus, {
  $id: 'MedicusHealthStatus'
});

export const DetailedHealthCheckSchema = Type.Object(
  {
    status: Type.Ref(HealthStatusSchema),
    debug: Type.Optional(
      Type.Record(Type.String(), Type.Union([Type.Number(), Type.Boolean(), Type.String()]))
    )
  },
  {
    $id: 'MedicusDetailedHealthCheck',
    additionalProperties: false
  }
);


export const HealthCheckResultSchema = Type.Object(
  {
    status: Type.Ref(HealthStatusSchema),
    services: Type.Record(Type.String(), Type.Ref(DetailedHealthCheckSchema))
  },
  {
    $id: 'MedicusHealthCheckResult',
    additionalProperties: false
  }
);

export const HealthCheckQueryParamsSchema = Type.Object(
  {
    last: Type.Optional(
      Type.Boolean({
        description: 'If set to true, the last health check result will be returned'
      })
    )
  },
  {
    $id: 'MedicusHealthCheckQueryParams',
    additionalProperties: false
  }
);

/**
 * An array containing all schemas to be easily added to a JSON schema validator
 */
export const AllSchemas = [
  DetailedHealthCheckSchema,
  HealthCheckResultSchema,
  HealthCheckQueryParamsSchema,
  HealthStatusSchema
];

import { Type } from '@sinclair/typebox';
import type { FastifyRequest, RouteOptions } from 'fastify';
import fp from 'fastify-plugin';
import { Medicus } from '../medicus';
import { AllSchemas, HealthCheckQueryParamsSchema, HealthCheckResultSchema } from '../schemas';
import { type HealthCheckResult, HealthStatus, type MedicusOption } from '../types';
import { HttpStatuses, healthStatusToHttpStatus } from '../utils/http';

declare module 'fastify' {
  interface FastifyInstance {
    /**
     * The medicus instance that can be used to perform health checks
     */
    medicus: Medicus;
  }
}

/**
 * A detector function that can be used to determine if the debug output should be shown
 */
export type DebugDetector = boolean | ((req: FastifyRequest) => boolean | Promise<boolean>);

export type FastifyMedicsPluginOptions = Omit<MedicusOption, 'manualClearBackgroundCheck'> & {
  /**
   * If the health check route should be hidden from the documentation
   *
   * @default false
   */
  hide?: boolean;

  /**
   * The route options to be passed to fastify
   *
   * @default { url: '/health', method: 'GET', logLevel: 'silent' }
   */
  route?: Partial<Omit<RouteOptions, 'handler'>>;

  /**
   * Whether to reply with a complete health check result or just the status
   *
   * @default false
   */
  debug?: DebugDetector;
};

export const medicusPlugin = fp<FastifyMedicsPluginOptions>(
  async (fastify, { route, debug = false, hide, ...medicusOptions }) => {
    fastify.decorate(
      'medicus',
      new Medicus({
        ...medicusOptions,
        // better to close on fastify close
        manualClearBackgroundCheck: true
      })
    );

    // @fastify/under-pressure plugin support
    if (fastify.hasPlugin('@fastify/under-pressure')) {
      fastify.medicus.addChecker({
        async pressure() {
          return {
            status: fastify.isUnderPressure() ? HealthStatus.DEGRADED : HealthStatus.HEALTHY,
            debug: fastify.memoryUsage()
          };
        }
      });
    }

    for (const schema of AllSchemas) {
      fastify.addSchema(schema);
    }

    fastify.route({
      url: '/health',
      method: 'GET',
      // disable logging for health check
      logLevel: 'silent',
      ...route,
      schema: {
        hide,
        tags: ['Health'],
        description: 'Performs a health check on the system',
        response: Object.fromEntries(
          HttpStatuses.map((status) => [status, Type.Ref(HealthCheckResultSchema)])
        ),
        querystring: Type.Ref(HealthCheckQueryParamsSchema),
        ...route?.schema
      },
      async handler(request, reply): Promise<HealthCheckResult> {
        let result: HealthCheckResult | null = null;

        //@ts-expect-error - untyped from querystring
        if (request.query.last) {
          result = this.medicus.getLastCheck();
        }

        if (!result) {
          result = await this.medicus.performCheck();
        }

        reply.status(healthStatusToHttpStatus(result.status));

        return {
          status: result.status,
          services: (typeof debug === 'boolean' ? debug : await debug(request))
            ? result.services
            : {}
        };
      }
    });

    if (medicusOptions.backgroundCheckInterval) {
      fastify.addHook('onClose', async function () {
        this.medicus.closeBackgroundCheck();
      });
    }
  },
  {
    fastify: '5.x',
    name: 'medicus/fastify'
  }
);

import { HealthStatus } from '../types';

/**
 * Converts a health status to an HTTP status code
 */
export function healthStatusToHttpStatus(status: HealthStatus): (typeof HttpStatuses)[number] {
  switch (status) {
    case HealthStatus.HEALTHY:
      return 200;
    case HealthStatus.DEGRADED:
      return 429;
    case HealthStatus.UNHEALTHY:
      return 503;
  }
}

/**
 * The list of HTTP status codes that can be returned by the health check
 */
export const HttpStatuses = [200, 429, 503] as const;

/**
 * RegExp to match cookie-name in RFC 6265 sec 4.1.1
 * This refers out to the obsoleted definition of token in RFC 2616 sec 2.2
 * which has been replaced by the token definition in RFC 7230 appendix B.
 *
 * cookie-name       = token
 * token             = 1*tchar
 * tchar             = "!" / "#" / "$" / "%" / "&" / "'" /
 *                     "*" / "+" / "-" / "." / "^" / "_" /
 *                     "`" / "|" / "~" / DIGIT / ALPHA
 */
const cookieNameRegExp = /^[!#$%&'*+\-.^_`|~0-9A-Za-z]+$/;

/**
 * RegExp to match cookie-value in RFC 6265 sec 4.1.1
 *
 * cookie-value      = *cookie-octet / ( DQUOTE *cookie-octet DQUOTE )
 * cookie-octet      = %x21 / %x23-2B / %x2D-3A / %x3C-5B / %x5D-7E
 *                     ; US-ASCII characters excluding CTLs,
 *                     ; whitespace DQUOTE, comma, semicolon,
 *                     ; and backslash
 */
const cookieValueRegExp =
  /^("?)[\u0021\u0023-\u002B\u002D-\u003A\u003C-\u005B\u005D-\u007E]*\1$/;

/**
 * RegExp to match domain-value in RFC 6265 sec 4.1.1
 *
 * domain-value      = <subdomain>
 *                     ; defined in [RFC1034], Section 3.5, as
 *                     ; enhanced by [RFC1123], Section 2.1
 * <subdomain>       = <label> | <subdomain> "." <label>
 * <label>           = <let-dig> [ [ <ldh-str> ] <let-dig> ]
 *                     Labels must be 63 characters or less.
 *                     'let-dig' not 'letter' in the first char, per RFC1123
 * <ldh-str>         = <let-dig-hyp> | <let-dig-hyp> <ldh-str>
 * <let-dig-hyp>     = <let-dig> | "-"
 * <let-dig>         = <letter> | <digit>
 * <letter>          = any one of the 52 alphabetic characters A through Z in
 *                     upper case and a through z in lower case
 * <digit>           = any one of the ten digits 0 through 9
 *
 * Keep support for leading dot: https://github.com/jshttp/cookie/issues/173
 *
 * > (Note that a leading %x2E ("."), if present, is ignored even though that
 * character is not permitted, but a trailing %x2E ("."), if present, will
 * cause the user agent to ignore the attribute.)
 */
const domainValueRegExp =
  /^([.]?[a-z0-9]([a-z0-9-]{0,61}[a-z0-9])?)([.][a-z0-9]([a-z0-9-]{0,61}[a-z0-9])?)*$/i;

/**
 * RegExp to match path-value in RFC 6265 sec 4.1.1
 *
 * path-value        = <any CHAR except CTLs or ";">
 * CHAR              = %x01-7F
 *                     ; defined in RFC 5234 appendix B.1
 */
const pathValueRegExp = /^[\u0020-\u003A\u003D-\u007E]*$/;

const __toString = Object.prototype.toString;

